import React, {Component} from 'react';
import { BrowserRouter, Link, Route } from 'react-router-dom';
import './Cards.css';

class Cards extends Component{
    render(){
        return(
            <div>
                <div>
                    <h1 className="Resources-Title">Our other resources</h1>
                </div>
                <div className="DashboardCard">
                    <div>
                        <Link className='App-link' to='/Dashboard'>COVID-19 Dashboard</Link>
                    </div>
                    <div>
                        <h1>Go here for data</h1>
                    </div>
                </div>
                <div></div>
                <div className="AboutCard">
                    <div>
                        <Link className='App-link' to='/Dashboard'>COVID-19 Dashboard</Link>
                    </div>
                    <div>
                        <h1>What is a symptom checker?</h1>
                    </div>
                </div>
            </div>
        )
    }
}

export default Cards;
